import React from "react";
import "./Solutions.css";

function Solutions() {
  return (
    <div className="solutions">
      <div className="searchbar">
        <input type="text" placeholder="Search for solutions" />
        <button>Search</button>
      </div>
    </div>
  );
}

export default Solutions;
